import React, {useState} from 'react';
import {Link, useNavigate} from "react-router-dom";
import ListView from '../listview'; // Import the GridView component

const data = [
    {id: 1, name: 'Item 1', description: 'Description 1'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},
    {id: 2, name: 'Item 2', description: 'Description 2'},

    // Add more items as needed
];

function AdminControl({userType}) {
    const [username, setUsername] = useState('');
    const [errorMessage, setErrorMessage] = useState('');
    const navigate = useNavigate();
    const submit = () => {
        if (username.trim() === '') {
            // Display an error message if the username is empty
            setErrorMessage(`${userType} fields cannot be empty`);
        } else {
            // Clear any previous error message
            setErrorMessage('');
            //   this.props.history.push(AdminAccess());

            // Handle login logic here (e.g., send username to the server)
            console.log(`Logging in as ${userType.value} with username: ${username}`);
        }
    };

    const getLoginTitle = () => {
        switch (userType) {
            case 'Gateway':
                return 'Delete the Gateway?';
            default:
                return 'Create an operator';
        }
    };

    const getPlc = () => {
        return `${userType} username`;
    };

    const geth2title = () => {
        console.log(userType + "Selected")
        switch (userType) {
            case 'Gateway':
                return `Gateway Deletion`;
            default:
                return `Operator Creation`;
        }
    };
    return (
        <div className="login-form">
            <h2>{geth2title()}</h2>
            <input
                type="text"
                placeholder={getPlc()}
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <button style={{margin: '10px 24px'}} onClick={submit}>{getLoginTitle()}</button>
            {errorMessage && <p className="error-message">{errorMessage}</p>}
        </div>
    );
}

function GatewayForm({userType}) {
    const [username, setUsername] = useState('');
    const [errorMessage, setErrorMessage] = useState('');
    const navigate = useNavigate();
    const submit = () => {
        if (username.trim() === '') {
            // Display an error message if the username is empty
            setErrorMessage(`${userType} fields cannot be empty`);
        } else {
            // Clear any previous error message
            setErrorMessage('');
            //   this.props.history.push(AdminAccess());

            // Handle login logic here (e.g., send username to the server)
            console.log(`Logging in as ${userType.value} with username: ${username}`);
        }
    };

    const getLoginTitle = () => {
        switch (userType) {
            case 'Gateway':
                return 'Delete the Gateway?';
            default:
                return 'Create an operator';
        }
    };

    const getPlc = () => {
        return `${userType} username`;
    };

    const geth2title = () => {
        console.log(userType + "Selected")
        switch (userType) {
            case 'Gateway':
                return `Gateway Deletion`;
            default:
                return `Operator Creation`;
        }
    };
    return (
        <div className="login-form">
            <h2>Gateway Creation and Updation</h2>
            <input
                type="text"
                placeholder="Operator Username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
             <input
                type="text"
                placeholder="Gateway name"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <input
                type="text"
                placeholder="Antenna diameter"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <input
                type="text"
                placeholder="Location name"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <input
                type="text"
                placeholder="Latitude"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <input
                type="text"
                placeholder="Longtitude"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                className="text-input"
            />
            <button style={{margin: '10px 24px 30px 20px'}} onClick={submit}>{"Insert"}</button>
            <button style={{margin: '10px 24px'}} onClick={submit}>{"Update"}</button>
            {errorMessage && <p className="error-message">{errorMessage}</p>}
        </div>
    );
}

function List(props) {
    return (
        <div style={{display: "flex", flexDirection: "column"}}>
            {props.list.map((item) => (
                <div>{item.description}</div>
            ))}
        </div>
    );
}

function AdminAccess() {
    return (
        <div>
            <div className="left-container">
                <AdminControl userType="Operator"/>
                <AdminControl userType='Gateway'/>
                <GatewayForm userType="Operator"/>
            </div>
            <div>
                <div style={{display: "flex", flexDirection: "row"}}>
                    <div style={{display: "flex", flexDirection: "column"}}>
                        <p>List of Operators</p>
                        {data.map((item) => (
                            <div>{item.description}</div>
                        ))}
                    </div>
                    <div style={{paddingLeft: 220, display: "flex", flexDirection: "column"}}>
                        <p>List of Gateways</p>
                        {data.map((item) => (
                            <div>{item.description}</div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default AdminAccess;
